import Head from 'next/head'

export default function Layout({ children }: { children: any }) {
	return (
		<>
			<Head>
				<title>Next FaunaDB test</title>
			</Head>
			<div className="flex justify-center w-full">
				{children}
			</div>
		</>
	)
}
